    "2016-04-06T23:21:05.379083",nt"name": "hospital-readmission-reduction",nt"isopen":
    true,nt"url": null,nt"notes": "<p>In October 2012, CMS began reducing Medicare
    payments for Inpatient Prospective Payment System hospitals with excess readmissions.
    Excess readmissions are measured by a ratio, by dividing a hospitalu2019s number
    of u201cpredictedu201d 30-day readmissions for heart attack, heart failure, and
    pneumonia by the number that would be u201cexpected,u201d based on an average hospital
    with similar patients. A ratio greater than 1 indicates excess readmissions.</p>n",nt"license_title":
